module.exports = "<!DOCTYPE html>\n<html lang=\"en\">\n  <head>\n    <meta charset=\"utf-8\">\n    <meta name=\"description\" content=\"A small gallery of works from Antoine Payet\">\n    <meta name=\"author\" content=\"Antoine Payet\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n    <title>Antoine Payet</title>\n    <!-- Favicons-->\n    <link rel=\"apple-touch-icon\" sizes=\"180x180\" href=\"images/apple-touch-icon.png\">\n    <link rel=\"icon\" type=\"image/png\" href=\"images/favicon-32x32.png\" sizes=\"32x32\">\n    <link rel=\"icon\" type=\"image/png\" href=\"images/favicon-16x16.png\" sizes=\"16x16\">\n    <link rel=\"manifest\" href=\"images/manifest.json\">\n    <link rel=\"mask-icon\" href=\"images/safari-pinned-tab.svg\" color=\"#5bbad5\">\n    <meta name=\"msapplication-config\" content=\"images/browserconfig.xml\">\n    <meta name=\"theme-color\" content=\"#ffffff\">\n  </head>\n  <body>\n    <header></header>\n    <main>\n      <section class=\"hero\">\n        <h1 class=\"hero__title\">Antoine Payet<span class=\"hero__subtitle\">Développeur Front-End</span></h1>\n      </section>\n      <section class=\"experience\">\n        <div class=\"col content\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">Not a portfolio, really.</h3>\n            <h2 class=\"experience__title\">\n               ‘Tis but a<br>humble display.</h2>\n            <p class=\"experience__desc\">\n               Of what I can already do. Of what I cannot do and am willing to learn.</p>\n            <p class=\"experience__desc grey\">All the pictures below have been chosen for their aesthetic. I did not use screenshots or logos from the actual companies because it would have been, well, uglier… and I am not sure I have the right to, anyway. Thanks Pexels for always being there. *un coeur qui bat*</p>\n          </div>\n        </div>\n        <div class=\"col content mario\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">It'sa me !</h3>\n            <h2 class=\"experience__title\">\n               Let’s have fun,<br>shall we ?</h2>\n            <p class=\"experience__desc\">\n               I am just your run-of-the-mill front-end developer. I wanted to be an artist. I like creativity and unleashing my imagination. I did not go that way because I also like money. The government seems pretty happy about my choice to pay more taxes.</p>\n            <p class=\"experience__desc grey\">Usually a well hidden secret, I feel that I should tell you before you read any further : I love working in music. Do not worry, I wear headphones. But I sing. And it’s terrible.</p>\n          </div>\n        </div>\n      </section>\n      <section class=\"experience\">\n        <div class=\"col content\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">Vroom Vroom.</h3>\n            <h2 class=\"experience__title aramis\">Aramisauto.</h2>\n            <p class=\"experience__desc\">\n               They sell cars. New ones. Used ones. The website was kind of old and not so pretty. I was brought into the team to help change that. I think we did okay.</p>\n            <p class=\"experience__desc grey\">As far as I know they are still working on the last updates but I had to take a breather far from all that pollution. </p>\n          </div>\n        </div>\n        <div class=\"col bg aramis\">\n          <picture class=\"experience__img\"><img src=\"" + __webpack_require__(2) + "\" alt=\"showcase slidor\"></picture>\n        </div>\n      </section>\n      <section class=\"experience\">\n        <div class=\"col content\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">focus.</h3>\n            <h2 class=\"experience__title nature\">\n               Nature &<br>Découvertes.</h2>\n            <p class=\"experience__desc\">\n               They sell a variety of things to help and encourage people to discover nature, and in turn, to respect and protect it.</p>\n            <p class=\"experience__desc grey\">Sounds kind of hippie. And hippies live on love and fresh water.</p>\n          </div>\n        </div>\n        <div class=\"col bg nature\">\n          <picture class=\"experience__img\"><img src=\"" + __webpack_require__(3) + "\" alt=\"green forest\"></picture>\n        </div>\n      </section>\n      <section class=\"experience\">\n        <div class=\"col content\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">Next !</h3>\n            <h2 class=\"experience__title slidor\">\n               Slidor.</h2>\n            <p class=\"experience__desc\">\n               Those of us who are not hippies need money to live. And what better way to obtain it than to get people to give it to you ? This is what Slidor is (mainly) about: creating breathtaking presentations in Microsoft Powerpoint to impress investors.</p>\n            <p class=\"experience__desc grey\">This website was coded only by yours truly (at the time) but each page describing a production was done by a different designer. It involved ~brainstorming~ fighting a lot over what was possible and what was a good, possible idea with 7 people in a row... Print designers are great and make amazing assets but they are NOT easy on the developers for the web.<br>But we almost won an Awwward for it. https://www.awwwards.com/sites/slidor-1</p>\n          </div>\n        </div>\n        <div class=\"col bg slidor\">\n          <picture class=\"experience__img\"><img src=\"" + __webpack_require__(4) + "\" alt=\"showcase slidor\"></picture>\n        </div>\n      </section>\n      <section class=\"experience\">\n        <div class=\"col content\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">To infinity and beyond.</h3>\n            <h2 class=\"experience__title kerala\">\n               Kerala<br>Ventures.</h2>\n            <p class=\"experience__desc\">\n               Speaking of investors, Kerala Ventures throw small french companies into the deep end of the pool to better launch them into space.</p>\n            <p class=\"experience__desc grey\">They love rockets. I love rockets.<br>I put rockets everywhere. They liked it.<br>That was fun.</p>\n          </div>\n        </div>\n        <div class=\"col bg kerala\">\n          <picture class=\"experience__img\"><img src=\"" + __webpack_require__(5) + "\" alt=\"rocket taking off at night\"></picture>\n        </div>\n      </section>\n      <section class=\"experience\">\n        <div class=\"col content\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">To infinity and beyond.</h3>\n            <h2 class=\"experience__title various\">\n               A little bit<br>of everything.</h2>\n            <p class=\"experience__desc\">\n               While working at Slidor, I not only coded their website, I also worked for a few of their clients who wished to offer to their own visitors a website that looked just like the presentation that was made for them: full of personality and pixel-perfectly pretty.</p>\n            <p class=\"experience__desc grey\">Ensue many hours of slightly moving this image. Slightly changing the timing of this animation. Slightly darkening the font color. Slightly killing myself every morning opening my messaging app. It was truly a great experience. I learned that sleep is just a concept.</p>\n          </div>\n        </div>\n        <div class=\"col bg various\">\n          <picture class=\"experience__img\"><img src=\"" + __webpack_require__(6) + "\" alt=\"artist painting in his shop\"></picture>\n        </div>\n      </section>\n      <section class=\"experience\">\n        <div class=\"col content\">\n          <div class=\"experience__content\">\n            <h3 class=\"experience__focus\">Playground.</h3>\n            <h2 class=\"experience__title codepen\">\n               Sometimes<br>I get bored.</h2>\n            <p class=\"experience__desc\">\n               And I make stuff. Or rather, I try to, abandon it halfway through and never finish it. And when I have enough of painting pixels, I switch to real-life painting.</p>\n            <p class=\"experience__desc grey\">I like Codepen because it is full of great ideas to steal for later… way later.</p>\n          </div>\n        </div>\n        <div class=\"col bg codepen\">\n          <picture class=\"experience__img\"><img src=\"" + __webpack_require__(7) + "\" alt=\"amusement park at night\"></picture>\n        </div>\n      </section>\n      <section class=\"contact\">\n        <p>Thank you for reading this far. Perhaps you would like to send me a message via LinkedIn ?</p>\n        <p> <em>I don't really give my personal email until the third date.</em></p>\n      </section>\n    </main>\n    <footer>\n      <p></p>\n      <p class=\"goodbye\">There is nothing left. you have to go, now...</p>\n    </footer>\n  </body>\n</html>";

